CREATE TABLE USER
	(password 		VARCHAR(9),
	name 		VARCHAR(100),
	CONSTRAINT pk_usuario PRIMARY KEY (password)
	
	);

CREATE TABLE CATEGORY
	(codeCategory	INT(10) AUTO_INCREMENT,
	nameCategory 		VARCHAR(100),
	CONSTRAINT pk_usuario PRIMARY KEY (codeCategory)
	
	);
	
CREATE TABLE CARD
	(codeCategory 		INT(10),
	code		INT(10) AUTO_INCREMENT,
	name 		VARCHAR(100),
	price		DOUBLE(10,2),
	acquisition date,
	deck_cards		boolean,
	CONSTRAINT pk_historial PRIMARY KEY(code),
	CONSTRAINT fk_historial FOREIGN KEY (codeCategory) REFERENCES CATEGORY(codeCategory) ON DELETE CASCADE
	);
	
